const colors = {
    primary: '#10002B',
    lightPrimary: '#240046',
    indigo: '#3c096c',
    purple: '#5a189a',
    violet: '#7b2cbf',
    orchid: '#9d4edd',
    heliotrope: '#c77dff',
    mauve: '#e0aaff',
};

export default colors;
